def search_song(input):
    if len(input) != 0:
        results = YoutubeSearch(input, max_results=2).to_dict()
        if len(results) != 0:
            datapod = results[0]
            tit = datapod["title"]
            cod = datapod["views"]
            dura = datapod["duration"]
            chan = datapod["channel"]
            vid_name_info.configure(text=tit)
            vid_views_info.configure(text=cod[:(len(cod)-8)])
            vid_duration_info.configure(text=dura)
            vid_channel_info.configure(text=chan)
            query.set(input)
            if save_location.get() == None:
                pass
            else:
                download_button.configure(state=app.NORMAL)
        else:
            pagetwoe = app.Tk(screenName='Musikas', className='Musikas-2')
            pagetwoe.geometry('450x150')
            pagetwoe['background'] = bgcolor
            frametwoe = ttk.Frame(pagetwoe, style='Frame1.TFrame')
            frametwoe.columnconfigure(0, weight=1)
            dfa = ttk.Label(pagetwoe, text="I could not find a video with the specified keywords.", font=('Tw Cen MT', 18), background=bgcolor, justify="center")
            dfa.pack(fill="both", expand=True, padx=10, pady=10)
            frametwoe.pack(fill="both", expand=True, padx=10, pady=10)

    else:
        pagetwoe = app.Tk(screenName='Musikas', className='Musikas-2')
        pagetwoe.geometry('450x150')
        pagetwoe['background'] = bgcolor
        frametwoe = ttk.Frame(pagetwoe, style='Frame1.TFrame')
        frametwoe.columnconfigure(0, weight=1)
        dfa = ttk.Label(pagetwoe, text="   Please enter a search query or youtube URL.", font=('Tw Cen MT', 18), background=bgcolor, justify="center")
        dfa.pack(fill="both", expand=True, padx=10, pady=10)
        frametwoe.pack(fill="both", expand=True, padx=10, pady=10)

def directoryone():
    asd = filedialog.asksaveasfilename()
    save_location.set(asd)
    location_label.configure(text=f"Location: {asd}     ")
