def get_url():
    s = query.get()
    results = YoutubeSearch(s, max_results=2).to_dict()
    datapod = results[0]
    url = datapod["url_suffix"]
    return(f'https://youtube.com/{url}')

def download_thread(url, filetype, dir):

    t1 = Thread(target=ydl_download, args = (url, filetype, dir))
    t1.start()

def ydl_download(url, filetype, dir):
    def my_hook(info):
        
        if info["status"] != "finished":
            percy = (info["downloaded_bytes"]/info["total_bytes"])*100
            perc = round(percy, 2)
            filesize = round(info["total_bytes"]/1000000, 2)
            time = datetime.timedelta(seconds=info["eta"])
            speed = round(info["speed"]/125000, 2)
            progress_bar['value'] =  round(perc)
            bar_label.configure(text=f'Progress:  {perc}')
            filesize_info.configure(text=f'{filesize} MB')
            eta_info.configure(text=time)
            speed_info.configure(text=f'{speed} Mbps')
        else:
            progress_bar['value'] =  0
            bar_label.configure(text=f'Progress:')
            filesize_info.configure(text='0 MB')
            eta_info.configure(text='Undetermined')
            speed_info.configure(text='0 Mbps')

    ydl_opts = {
    'format': 'bestaudio/best',
    'postprocessors': [{
        'key': 'FFmpegExtractAudio',
        'preferredcodec': str(filetype.lower()),
        'preferredquality': '192',
    }],
    'outtmpl': f'{dir}.{str(filetype.lower())}',
    'progress_hooks': [my_hook],
    'quiet': True
    }
    with youtube_dl.YoutubeDL(ydl_opts) as ydl:
        ydl.download([url])
    location_info.configure(state=app.NORMAL)
    search_button.configure(state=app.NORMAL)
    askopenfile(mode ='r', filetypes =[(f'{filetype} files', f'*.{filetype}')])


